import React, { useState, useEffect, useRef } from "react";
import { Link } from "react-router-dom";
import '../styles/game-modes.css';

export default function Home() {
    return (
       
        <div className="home-content">
            <Link to="/classic">  
            <div className="classic-mode game-mode">
                   
                    <h2>Classic</h2>
                
            </div>
            </Link>
            <div className="online-mode game-mode">
                <h2>Online</h2>
            </div>

            <div className="computer-mode game-mode">
                <h2>Computer</h2>
            </div>
        </div>
    );
};
